import { Parallax, Background } from 'react-parallax';

const Kisar = () => (
  <Parallax
    blur={{ min: -15, max: 15 }}
    bgImage={require('https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.facebook.com%2F355120697915665%2Fphotos%2Faca-tienen-un-fondo-rosado-by-axelrouce%2F355184031242665%2F&psig=AOvVaw3PBN8E7KAN27sRCUH0qw8j&ust=1605997071466000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCLjuyLuTku0CFQAAAAAdAAAAABAP')}
    bgImageAlt="the dog"
    strength={-200}>
    Blur transition from min to max
    <div style={{ height: '200px' }} />
  </Parallax>
);
export default Kisar;
